    //address  cüzdan adress leri anlamına geliyor
     address owner;
     constructor()
     {
         owner=msg.sender;//  sender sözleşmeyi  ağa dağıtan kişi anlamına gelir  sözleşmeyi
         // sözleşmeyi  yaratan  kişidir.Baba oğullarına  belli bir  periyotta para göndermek için
         // bir smart contract olusturmussa bu sözleşmenin senderı babadır.


     }
// define kid
     struct Kid{
         address payable walletAddress;
         string fullName;
         string lastName;
         uint releaseTime;
         uint amount;
         bool canWithdraw;

     }
Kid[] public kids;

// add kid to contract
function addKid(address payable walletAddress,string memory fullName,string memory lastName,uint releaseTime,uint amount,bool canWithdraw) public {
    return
    kids.push(Kid(
        walletAddress,
         fullName,
         lastName,
          releaseTime,
        amount,
         canWithdraw));
}

function balanceof() public view returns(uint){
    return address(this).balance;
}

// adresten transfer edilen toplam tutarı göstren bir fonksyondur view key wordu ise blockchain ile baglantı kurularak gaz maliyetine sebep olmayan  bir  sonuc oldugunu ve değiştirilemyeceğı anlamına gelir sadece sonucun gorulebilmesini sağlar pure ise değerin okunmasına dahi izin vermez



//depeosit funds to contract specifically to  a kid's  account


function deposit ( address walletAddress) payable public{
addtoKidsBalance(walletAddress);

} // normalde para yatırma fonksyonu doğrudan bu hesap hash kodu verilerek o hesaba istenilen para yatırılabilir.

function addtoKidsBalance(address walletAddress) private {

    for(uint i=0;i<kids.length;i++)
    {
        if(kids[i].walletAddress==walletAddress)
        {
            kids[i].amount+=msg.value;//msg value hesapta bulunan coin miktarı
        }
    }
}

//memory keywordu sahip olduğu değerin geçici hafızada tutulmasını ve sonradan değiştirilebilceği anlamına gelir fonksyon içerisinde  değer atayarak  bu keyworda sahip değişkenlerin değerlerini değiştirebilirsin calldata da  veriyi geçici olarak tutar
// ama  burada yazılan veri bir daha değiştirilemez ayrıca calldata içerisine yazılan verilerde boyut sınırı vardır.
/*
uniti de tarih olarak kullanmak istediğinde tarihi  unix hale getirerek doğrudan sayı olarak ifade etmek için epochconverter  de tarihi timestamp gibi sayısal ifadeye cevirerek kullanılır

func

*/

function getindex(address walletAddress) view private returns(uint){
    for(uint i=0;i<kids.length;i++)
    {
        if(kids[i].walletAddress==walletAddress)
        {
           return i;
        }
    }
    return 999;
}

function availableTowithdraw(address walletAddress) public returns(bool)
{
uint i= getindex(walletAddress);
if(block.timestamp>kids[i].releaseTime)
{
     kids[i].canWithdraw=true;
     return true;
    
}
return false;
}

function withdraw(address payable  walletAddress) payable public{

    uint i = getindex(walletAddress);
    require(msg.sender==kids[i].walletAddress,"You must ve the kid to withdraw");//işlemi başlatan cüzdanın kendi cüzdanı olması gerek
    require(kids[i].canWithdraw==true,"not withdraw yet"); // canwithdraw true olmak zorunda

    kids[i].walletAddress.transfer(kids[i].amount);
}


